DROP TABLE IF EXISTS `basebooks`;
CREATE TABLE `basebooks`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '显示名称',
  `show_spine` tinyint(10) NOT NULL DEFAULT 0 COMMENT '是否显示书脊',
  `double_page` tinyint(1) NOT NULL DEFAULT 0 COMMENT '双页连页',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '描述',
  `enable` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否有效',
  `sort` int(11) NOT NULL DEFAULT 0 COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

