DROP TABLE IF EXISTS `basepages`;
CREATE TABLE `basepages`  (
  `basebook_id` int(11) NOT NULL,
  `page_type` tinyint(4) NOT NULL COMMENT '页面类型，0：护封，1：封面，2内容页',
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '页面类型名称',
  `width` int(11) NOT NULL COMMENT '页面尺寸宽度，单位：毫米mm',
  `height` int(11) NOT NULL COMMENT '页面尺寸高度，单位：毫米mm',
  `bleed_top` int(255) NOT NULL COMMENT '出血线：上，单位：毫米',
  `bleed_right` int(255) NOT NULL COMMENT '出血线：右，单位：毫米',
  `bleed_bottom` int(255) NOT NULL COMMENT '出血线：下，单位：毫米',
  `bleed_left` int(255) NOT NULL COMMENT '出血线：左，单位：毫米',
  `single_page` tinyint(255) NOT NULL COMMENT '是否单页',
  `min_pages` int(255) NOT NULL COMMENT '最少页数',
  `max_pages` int(255) NOT NULL COMMENT '最多页数',
  `enable` tinyint(255) NOT NULL COMMENT '是否启用',
  `sort` int(255) NOT NULL COMMENT '排序',
  PRIMARY KEY (`page_type`, `basebook_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

