DROP TABLE IF EXISTS `books`;
CREATE TABLE `books`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `theme` int(11) NOT NULL COMMENT '模板id',
  `basebook_id` int(11) NOT NULL COMMENT 'basebook表外键',
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '书名',
  `author` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '作者',
  `show_page_num` tinyint(1) NOT NULL COMMENT '是否显示页码',
  `fascicule` int(11) NOT NULL COMMENT '分册：0不是分册，大于0：分册',
  `fascicule_type` tinyint(11) NOT NULL COMMENT '分册显示类型：0：汉字，1：阿拉伯数字，2：带圆圈阿拉伯数字，3：罗马数字',
  `created_at` timestamp(0) NOT NULL COMMENT '创建时间',
  `updated_at` timestamp(0) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

