-- ----------------------------
-- Table structure for pages
-- ----------------------------
DROP TABLE IF EXISTS `pages`;
CREATE TABLE `pages`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `book_id` int(11) NOT NULL COMMENT '所属书的id',
  `page_type` tinyint(4) NOT NULL COMMENT '页面类型，0：护封，1：封面，2内容页',
  `page_group` tinyint(4) NOT NULL COMMENT '内页分组，0：内容页前置，1：内容页，2：内容页后置',
  `flag` tinyint(255) NOT NULL COMMENT '左右页标识：0左，1右，2双',
  `background` json NULL COMMENT '背景设置',
  `elements` json NULL COMMENT '页面元素',
  `sort` int(255) NOT NULL COMMENT '排序',
  `is_deleted` tinyint(255) NOT NULL DEFAULT 0 COMMENT '是否删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

